import React, {useState} from "react";

/*import {Button} from "reactstrap";

import {Modal, ModalHeader, ModalBody, ModalFooter, FormGroup, Input, Label} from "reactstrap";*/

import { Modal, Button, FormGroup, I } from 'react-bootstrap'

import 'bootstrap/dist/css/bootstrap.min.css';


const TestButton = (props) => {

    const [show, setShow] = useState(true);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);
    
    return(
        <>
        <div className="principal">

            <div className="secundario">

                <Button variant="primary" onClick={handleClose}> Primary</Button>

            </div> 
        </div>

        <Modal show={show} onHide={handleShow}>
            <Modal.Header> Iniciar Sesión </Modal.Header>
                
            <Modal.Body> 
                <FormGroup>
                    <Label for = "usuario"> Usuario </Label>
                    <Input type = "text" id="usuario"/>
                </FormGroup>

                <FormGroup>
                    <Label for = "pass"> Pass </Label>
                    <Input type = "text" id="pass"/>
                </FormGroup> 

            </Modal.Body>

            <Modal.Footer> 
                <Button variant="secondary" onClick={handleClose}>
                    Close
                </Button>
            </Modal.Footer>

        </Modal>
        </>
    )
}

export default TestButton;
